import { useEffect, useState } from 'react';
import React from 'react';
import CarItem from './CarItem';
import '../Styles/CarManagement.css';
import car1 from '../assets/images/car1.jpg';
import car2 from '../assets/images/car2.jpg';
import car3 from '../assets/images/car3.jpg';
import car4 from '../assets/images/car4.jpg';
import car5 from '../assets/images/car5.jpg';

const carImages = [car1, car2, car3, car4, car5];

function CarManagement() {
    const [cars, setCars] = useState([]);
    const [newKilometers, setNewKilometers] = useState("");
    const [newReleaseDate, setNewReleaseDate] = useState("");
    const [newModel, setNewModel] = useState("");
    const [newVehicleType, setNewVehicleType] = useState("");
    const [newPrice, setNewPrice] = useState("");
    const [newColor, setNewColor] = useState("");
    const [newShowroomId, setNewShowroomId] = useState("");
    const [showAddForm, setShowAddForm] = useState(false);

    useEffect(() => {
        fetch("http://localhost:8080/api/car")
            .then(response => {
                if (!response.ok) {
                    throw new Error("Eroare la încărcarea datelor");
                }
                return response.json();
            })
            .then(data => {
                const carsWithImages = data.map((car, index) => ({
                    ...car,
                    imageUrl: carImages[index % carImages.length]
                }));
                setCars(carsWithImages);
            })
            .catch(error => console.error("Eroare:", error));
    }, []);

    // Funcția pentru adăugarea unei mașini
    const handleAddCar = () => {
        const newCar = {
            kilometers: parseInt(newKilometers, 10),
            releaseDate: newReleaseDate,
            model: newModel,
            vehicleType: newVehicleType,
            price: parseInt(newPrice, 10),
            color: newColor,
            showroom: { idShowroom: parseInt(newShowroomId, 10) },
        };

        fetch("http://localhost:8080/api/car", {
            method: "POST",
            headers: { "Content-Type": "application/json" },
            body: JSON.stringify(newCar),
        })
            .then(response => {
                if (!response.ok) {
                    throw new Error("Eroare la adăugarea mașinii");
                }
                return response.json();
            })
            .then(savedCar => {
                console.log("Mașină adăugată:", savedCar);
                const savedCarWithImage = {
                    ...savedCar,
                    imageUrl: carImages[cars.length % carImages.length],
                };
                setCars([...cars, savedCarWithImage]); // Adaugă mașina la listă
                setNewKilometers("");
                setNewReleaseDate("");
                setNewModel("");
                setNewVehicleType("");
                setNewPrice("");
                setNewColor("");
                setNewShowroomId("");
                setShowAddForm(false); // Ascunde formularul
            })
            .catch(error => console.error("Eroare la adăugarea mașinii:", error));
    };

    return (
        <div>
            <h3>Management Mașini</h3>

            {/* Buton pentru afișarea formularului */}
            <div className="button-container">
                <button onClick={() => setShowAddForm(!showAddForm)}>
                    {showAddForm ? "Anulează Adăugarea Mașinii" : "Adaugă Mașină"}
                </button>
            </div>

            {/* Formular pentru adăugarea unei mașini */}
            {showAddForm && (
                <div className="add-form">
                    <h3>Adaugă Mașină Nouă</h3>
                    <label>
                        Kilometri:
                        <input
                            type="number"
                            value={newKilometers}
                            onChange={(e) => setNewKilometers(e.target.value)}
                        />
                    </label>
                    <label>
                        Data Lansării:
                        <input
                            type="date"
                            value={newReleaseDate}
                            onChange={(e) => setNewReleaseDate(e.target.value)}
                        />
                    </label>
                    <label>
                        Model:
                        <input
                            type="text"
                            value={newModel}
                            onChange={(e) => setNewModel(e.target.value)}
                        />
                    </label>
                    <label>
                        Tip Vehicul:
                        <input
                            type="text"
                            value={newVehicleType}
                            onChange={(e) => setNewVehicleType(e.target.value)}
                        />
                    </label>
                    <label>
                        Preț:
                        <input
                            type="number"
                            value={newPrice}
                            onChange={(e) => setNewPrice(e.target.value)}
                        />
                    </label>
                    <label>
                        Culoare:
                        <input
                            type="text"
                            value={newColor}
                            onChange={(e) => setNewColor(e.target.value)}
                        />
                    </label>
                    <label>
                        ID Showroom:
                        <input
                            type="number"
                            value={newShowroomId}
                            onChange={(e) => setNewShowroomId(e.target.value)}
                        />
                    </label>
                    <button onClick={handleAddCar}>Adaugă</button>
                    <button onClick={() => setShowAddForm(false)}>Anulează</button>
                </div>
            )}

            {/* Listarea mașinilor */}
            <div className="car-list">
                {cars.length > 0 ? (
                    cars.map((car) => (
                        <CarItem key={car.idCar} car={car} imageUrl={car.imageUrl} />
                    ))
                ) : (
                    <p>Nu există mașini disponibile.</p>
                )}
            </div>
        </div>
    );
}

export default CarManagement;
